35.body:
In software, a "lint" is a tool used to help improve your source code. The Rust compiler contains a number of lints, and when it compiles your code, it will also run the lints. These lints may produce a warning, an error, or nothing at all, depending on how you've configured things. Here's a small example: $ cat main.rs
fn main() { let x = 5;
}
$ rustc main.rs
warning: unused variable: `x` --> main.rs:2:9 |
2 | let x = 5; | ^ | = note: `#[warn(unused_variables)]` on by default = note: to avoid this warning, consider using `_x` instead This is the unused_variables lint, and it tells you that you've introduced a variable that you don't use in your code. That's not wrong , so it's not an error, but it might be a bug, so you get a warning.

38.body:
The 'warn' lint level will produce a warning if you violate the lint. For example, this code runs afoul of the unused_variable lint: pub fn foo() { let x = 5;
} This will produce this warning: $ rustc lib.rs --crate-type=lib
warning: unused variable: `x` --> lib.rs:2:9 |
2 | let x = 5; | ^ | = note: `#[warn(unused_variables)]` on by default = note: to avoid this warning, consider using `_x` instead

39.body:
A 'deny' lint produces an error if you violate it. For example, this code runs into the exceeding_bitshifts lint. fn main() { 100u8 << 10;
} $ rustc main.rs
error: bitshift exceeds the type's number of bits --> main.rs:2:13 |
2 | 100u8 << 10; | ^^^^^^^^^^^ | = note: `#[deny(exceeding_bitshifts)]` on by default What's the difference between an error from a lint and a regular old error? Lints are configurable via levels, so in a similar way to 'allow' lints, warnings that are 'deny' by default let you allow them. Similarly, you may wish to set up a lint that is warn by default to produce an error instead. This lint level gives you that.

43.body:
You can also modify the lint level with a crate-wide attribute: $ cat lib.rs
#![warn(missing_docs)] pub fn foo() {}
$ rustc lib.rs --crate-type=lib
warning: missing documentation for crate --> lib.rs:1:1 |
1 | / #![warn(missing_docs)]
2 | |
3 | | pub fn foo() {} | |_______________^ |
note: lint level defined here --> lib.rs:1:9 |
1 | #![warn(missing_docs)] | ^^^^^^^^^^^^ warning: missing documentation for a function --> lib.rs:3:1 |
3 | pub fn foo() {} | ^^^^^^^^^^^^ All four, warn, allow, deny, and forbid all work this way. You can also pass in multiple lints per attribute: #![warn(missing_docs, unused_variables)] pub fn foo() {} And use multiple attributes together: #![warn(missing_docs)]
#![deny(unused_variables)] pub fn foo() {}

